/*Data for the table `tb_active` */

insert  into `tb_active` values (1,'县乡会议','召开IT技术大会',1,'/static/images/elliot.jpg','100',10,1,'紫檀祥源','紫檀祥源详细地址','2018-08-05 00:00:00','2018-08-10 00:00:00','2018-08-12 14:30:00',1,'<p>3分钟哔哔一下本周游戏圈大事件！</p>\r\n<p><strong>哔哔1：Steam中国版确认有审核系统！网友：盗版行业要复活？</strong></p>\r\n<p>最近完美世界发布了Steam中国版的招聘职位，其中一项是负责“内容审核系统”，这等于确认了Steam中国版的游戏需要经过审核才能上线，必须符合国内的法规。</p>\r\n<p class=\"p-image\" style=\"text-align: center;\"><img src=\"//i.17173cdn.com/2fhnvk/YWxqaGBf/cms3/mFmqSqbmufjloxw.jpg\" width=\"550\" height=\"309\" alt=\"22-31.jpg\"></p>\r\n<p>相信Steam国内玩家将面临一个大问题，那就是Steam中国版正式上线后，原版是否还能用？目前我们还没有答案。</p>\r\n<p><strong>只有星星没太阳：</strong>仿佛看到未来，盗版举起义旗，打击正版。</p>\r\n<p><strong>WJ王自如：</strong>然后会发现外服上不了了，国服的游戏满满小清新正能量。</p>\r\n<p><strong>阿罩：</strong>大家放心，以后Steam只不过就两个东西不能玩：这也不能玩，那也不能玩。</p>\r\n<p><strong>泰德语风：</strong>魔兽玩家都应该知道，地上一个骷髅头和谐成面粉袋的故事。</p>'),(2,'市县会议','召开落实十九大精神，会议内容很长，主要讲述国家未来发展战略，以及以科学发展观促进农村发展',1,'/static/images/elyse.png','0',120,1,'科海大楼','科海大楼详细地址','2018-03-01 00:00:00','2018-03-14 00:00:00','2018-03-15 15:00:00',0,'<p>3分钟哔哔一下本周游戏圈大事件！</p>\r\n<p><strong>哔哔1：Steam中国版确认有审核系统！网友：盗版行业要复活？</strong></p>\r\n<p>最近完美世界发布了Steam中国版的招聘职位，其中一项是负责“内容审核系统”，这等于确认了Steam中国版的游戏需要经过审核才能上线，必须符合国内的法规。</p>\r\n<p class=\"p-image\" style=\"text-align: center;\"><img src=\"//i.17173cdn.com/2fhnvk/YWxqaGBf/cms3/mFmqSqbmufjloxw.jpg\" width=\"550\" height=\"309\" alt=\"22-31.jpg\"></p>\r\n<p>相信Steam国内玩家将面临一个大问题，那就是Steam中国版正式上线后，原版是否还能用？目前我们还没有答案。</p>\r\n<p><strong>只有星星没太阳：</strong>仿佛看到未来，盗版举起义旗，打击正版。</p>\r\n<p><strong>WJ王自如：</strong>然后会发现外服上不了了，国服的游戏满满小清新正能量。</p>\r\n<p><strong>阿罩：</strong>大家放心，以后Steam只不过就两个东西不能玩：这也不能玩，那也不能玩。</p>\r\n<p><strong>泰德语风：</strong>魔兽玩家都应该知道，地上一个骷髅头和谐成面粉袋的故事。</p>'),(3,'省级会议','召开省级会议，会议内容不要紧，召开省级会议，会议内容不要紧，召开省级会议，会议内容不要紧召开省级会议，会议内容不要紧，召开省级会议，会议内容不要紧',0,'/static/images/jenny.jpg','100',10,1,'百度大楼','百度大楼详细地址','2017-12-01 00:00:00','2018-03-18 00:00:00','2018-03-18 15:00:00',0,'<p>3分钟哔哔一下本周游戏圈大事件！</p>\r\n<p><strong>哔哔1：Steam中国版确认有审核系统！网友：盗版行业要复活？</strong></p>\r\n<p>最近完美世界发布了Steam中国版的