/*Table structure for table `tb_competitions` */

DROP TABLE IF EXISTS `tb_competitions`;

CREATE TABLE `tb_competitions` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(30) NOT NULL COMMENT '大赛名称',
  `picture` varchar(80) DEFAULT NULL COMMENT '大赛图片',
  `limit` int(10) NOT NULL DEFAULT '0' COMMENT '人数限制',
  `register` int(10) NOT NULL DEFAULT '0' COMMENT '参赛人数',
  `recommend` tinyint(2) DEFAULT '0' COMMENT '是否推荐',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '大赛状态',
  `time` datetime DEFAULT NULL COMMENT '大赛时间',
  `begin_time` datetime DEFAULT NULL COMMENT '报名开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '报名结束时间',
  `audit_method` tinyint(2) DEFAULT '0' COMMENT '审核方式',
  `rich_text` text COMMENT '富文本区域',
  PRIMARY KEY (`id`),
  KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='大赛表';

