/*Table structure for table `tb_forums` */

DROP TABLE IF EXISTS `tb_forums`;

CREATE TABLE `tb_forums` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '活动主键',
  `title` varchar(60) NOT NULL DEFAULT '' COMMENT '论坛标题',
  `content` varchar(255) DEFAULT '' COMMENT '论坛内容',
  `recommend` tinyint(2) DEFAULT '0' COMMENT '是否推荐',
  `picture` varchar(80) DEFAULT '' COMMENT '论坛图片',
  `limit` varchar(50) DEFAULT '' COMMENT '人员限制',
  `register` varchar(40) DEFAULT '0' COMMENT '报名人数',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '论坛状态',
  `address` varchar(255) DEFAULT '' COMMENT '论坛简写地点',
  `location` varchar(255) DEFAULT NULL COMMENT '论坛详细地址',
  `begin_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `apply_time` datetime DEFAULT NULL COMMENT '论坛时间',
  `audit_method` tinyint(2) DEFAULT '0' COMMENT '审核方式',
  `rich_text` text COMMENT '富文本区域',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE
