/*Table structure for table `tb_review` */

DROP TABLE IF EXISTS `tb_review`;

CREATE TABLE `tb_review` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '回顾主键',
  `title` varchar(40) DEFAULT '' COMMENT '回顾标题',
  `content` text COMMENT '回顾内容',
  `picture` varchar(255) DEFAULT '' COMMENT '回顾图片',
  `publish_time` timestamp NULL DEFAULT NULL,
  `recommend` tinyint(4) DEFAULT '0' COMMENT '是否推荐',
  `richtext` text COMMENT '富文本区域',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

