insert  into `tb_review` values (1,'测试Java','测试关于Java的相关api接口和web接口','/static/images/bg1.png','2018-07-24 00:00:00',0,NULL),(2,'测试Python','测试Python相关api接口和web自动化接口，以及关于数据爬虫的使用','/static/images/bg2.png','2018-07-28 00:00:00',1,NULL),(3,'测试PHP','测试PHP相关的api接口和web接口','','2018-08-25 00:00:00',1,NULL),(4,'123123','1231231',NULL,'2018-08-08 14:35:41',0,''),(5,'测试JavaScript脚本','测试JavaScript编写的脚本服务接口','/static/images/bg3.png','2018-08-12 00:00:00',1,NULL),(6,'测试下咯2','正文部分的简介说明','/images/20180807/53c7b13c1d2daf798df65b8dec5f2d76.png','2018-08-07 00:00:00',0,'&lt;div id=&quot;s-290330833&quot;&gt;&lt;h1 data-line=&quot;0&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;_0&quot;&gt;&lt;/a&gt;查询表达式&lt;/h1&gt; &lt;table&gt;&lt;thead&gt;&lt;tr&gt;&lt;th&gt;版本&lt;/th&gt;&lt;th&gt;新增功能&lt;/th&gt;&lt;/tr&gt;&lt;/thead&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td&gt;5.0.9&lt;/td&gt;&lt;td&gt;比较运算增加闭包子查询支持&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;5.0.4&lt;/td&gt;&lt;td&gt;支持对同一个字段多次调用查询方法&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt; &lt;p&gt;查询表达式支持大部分的SQL查询语法，也是&lt;code&gt;ThinkPHP&lt;/code&gt;查询语言的精髓，查询表达式的使用格式：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-selector-tag&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'字段名\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'表达式\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'查询条件\'&lt;/span&gt;); &lt;span class=&quot;hljs-selector-tag&quot;&gt;whereOr&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'字段名\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'表达式\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'查询条件\'&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表达式不分大小写，支持的查询表达式有下面几种，分别表示的含义是：&lt;/p&gt; &lt;table&gt;&lt;thead&gt;&lt;tr&gt;&lt;th&gt;表达式&lt;/th&gt;&lt;th&gt;含义&lt;/th&gt;&lt;/tr&gt;&lt;/thead&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td&gt;EQ、=&lt;/td&gt;&lt;td&gt;等于（=）&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;NEQ、&amp;lt;&amp;gt;&lt;/td&gt;&lt;td&gt;不等于（&amp;lt;&amp;gt;）&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;GT、&amp;gt;&lt;/td&gt;&lt;td&gt;大于（&amp;gt;）&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;EGT、&amp;gt;=&lt;/td&gt;&lt;td&gt;大于等于（&amp;gt;=）&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;LT、&amp;lt;&lt;/td&gt;&lt;td&gt;小于（&amp;lt;）&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;ELT、&amp;lt;=&lt;/td&gt;&lt;td&gt;小于等于（&amp;lt;=）&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;LIKE&lt;/td&gt;&lt;td&gt;模糊查询&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;[NOT] &lt;span class=&quot;highlight&quot;&gt;BETWEEN&lt;/span&gt;&lt;/td&gt;&lt;td&gt;（不在）区间查询&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;[NOT] IN&lt;/td&gt;&lt;td&gt;（不在）IN 查询&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;[NOT] NULL&lt;/td&gt;&lt;td&gt;查询字段是否（不）是NULL&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;[NOT] EXISTS&lt;/td&gt;&lt;td&gt;EXISTS查询&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;EXP&lt;/td&gt;&lt;td&gt;表达式查询，支持SQL语法&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;&amp;gt; time&lt;/td&gt;&lt;td&gt;时间比较&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;&amp;lt; time&lt;/td&gt;&lt;td&gt;时间比较&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;&lt;span class=&quot;highlight&quot;&gt;between&lt;/span&gt; time&lt;/td&gt;&lt;td&gt;时间比较&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;not&lt;span class=&quot;highlight&quot;&gt;between&lt;/span&gt; time&lt;/td&gt;&lt;td&gt;时间比较&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt; &lt;p&gt;表达式查询的用法示例如下：&lt;/p&gt; &lt;h2 data-line=&quot;37&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;EQ__37&quot;&gt;&lt;/a&gt;EQ ：等于（=）&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'eq\'&lt;/span&gt;,100); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'=\'&lt;/span&gt;,100); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;和下面的查询等效&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;where&lt;/span&gt;(\'&lt;span class=&quot;hljs-built_in&quot;&gt;id&lt;/span&gt;\',&lt;span class=&quot;hljs-number&quot;&gt;100&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表示的查询条件就是&amp;nbsp;&lt;code&gt;id = 100&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;54&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;NEQ__54&quot;&gt;&lt;/a&gt;NEQ： 不等于（&amp;lt;&amp;gt;）&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'neq\'&lt;/span&gt;,100); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'&amp;lt;&amp;gt;\'&lt;/span&gt;,100); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表示的查询条件就是&amp;nbsp;&lt;code&gt;id &amp;lt;&amp;gt; 100&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;65&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;GT_65&quot;&gt;&lt;/a&gt;GT：大于（&amp;gt;）&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'gt\'&lt;/span&gt;,100); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'&amp;gt;\'&lt;/span&gt;,100); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表示的查询条件就是&amp;nbsp;&lt;code&gt;id &amp;gt; 100&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;76&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;EGT_76&quot;&gt;&lt;/a&gt;EGT：大于等于（&amp;gt;=）&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'egt\'&lt;/span&gt;,100); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'&amp;gt;=\'&lt;/span&gt;,100); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表示的查询条件就是&amp;nbsp;&lt;code&gt;id &amp;gt;= 100&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;87&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;LT_87&quot;&gt;&lt;/a&gt;LT：小于（&amp;lt;）&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'lt\'&lt;/span&gt;,100); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'&amp;lt;\'&lt;/span&gt;,100); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表示的查询条件就是&amp;nbsp;&lt;code&gt;id &amp;lt; 100&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;98&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;ELT__98&quot;&gt;&lt;/a&gt;ELT： 小于等于（&amp;lt;=）&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'elt\'&lt;/span&gt;,100); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'&amp;lt;=\'&lt;/span&gt;,100); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;表示的查询条件就是&amp;nbsp;&lt;code&gt;id &amp;lt;= 100&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;109&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;NOT_LIKE_sqlLIKE_109&quot;&gt;&lt;/a&gt;[NOT] LIKE： 同sql的LIKE&lt;/h2&gt; &lt;p&gt;例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'name\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'like\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'thinkphp%\'&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;查询条件就变成&amp;nbsp;&lt;code&gt;name like \'thinkphp%\'&lt;/code&gt;&lt;/p&gt; &lt;p&gt;&lt;code&gt;V5.0.5+&lt;/code&gt;版本开始，like查询支持使用数组&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'name\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'like\'&lt;/span&gt;,[&lt;span class=&quot;hljs-string&quot;&gt;\'%think\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'php%\'&lt;/span&gt;],&lt;span class=&quot;hljs-string&quot;&gt;\'OR\'&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;h2 data-line=&quot;124&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;NOT_BETWEEN_sqlnot_between_124&quot;&gt;&lt;/a&gt;[NOT] &lt;span class=&quot;highlight&quot;&gt;BETWEEN&lt;/span&gt; ：同sql的[not] &lt;span class=&quot;highlight&quot;&gt;between&lt;/span&gt;&lt;/h2&gt; &lt;p&gt;查询条件支持字符串或者数组，例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'id\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'between\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'1,8\'&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;和下面的等效：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;where&lt;/span&gt;(\'&lt;span class=&quot;hljs-built_in&quot;&gt;id&lt;/span&gt;\',\'&lt;span class=&quot;hljs-keyword&quot;&gt;between&lt;/span&gt;\',[&lt;span class=&quot;hljs-number&quot;&gt;1&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;8&lt;/span&gt;]); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;查询条件就变成&amp;nbsp;&lt;code&gt;id &lt;span class=&quot;highlight&quot;&gt;BETWEEN&lt;/span&gt; 1 AND 8&lt;/code&gt;&lt;/p&gt; &lt;h2 data-line=&quot;140&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;NOT_IN_sqlnot_in_140&quot;&gt;&lt;/a&gt;[NOT] IN： 同sql的[not] in&lt;/h2&gt; &lt;p&gt;查询条件支持字符串或者数组，例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;where(&lt;span class=&quot;hljs-symbol&quot;&gt;\'id&lt;/span&gt;&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;not&lt;/span&gt; &lt;span class=&quot;hljs-keyword&quot;&gt;in&lt;/span&gt;&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt;&lt;span class=&quot;hljs-number&quot;&gt;1&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;5&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;8&lt;/span&gt;\'); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;和下面的等效：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;where(&lt;span class=&quot;hljs-symbol&quot;&gt;\'id&lt;/span&gt;&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;not&lt;/span&gt; &lt;span class=&quot;hljs-keyword&quot;&gt;in&lt;/span&gt;\',[&lt;span class=&quot;hljs-number&quot;&gt;1&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;5&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;8&lt;/span&gt;]); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;查询条件就变成&amp;nbsp;&lt;code&gt;id NOT IN (1,5, 8)&lt;/code&gt;&lt;/p&gt; &lt;blockquote class=&quot;info&quot;&gt;&lt;p&gt;&lt;code&gt;[NOT] IN&lt;/code&gt;查询支持使用闭包方式&lt;/p&gt;&lt;/blockquote&gt; &lt;h2 data-line=&quot;158&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;NOT_NULL__158&quot;&gt;&lt;/a&gt;[NOT] NULL ：&lt;/h2&gt; &lt;p&gt;查询字段是否（不）是&lt;code&gt;Null&lt;/code&gt;，例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'name\'&lt;/span&gt;, &lt;span class=&quot;hljs-literal&quot;&gt;null&lt;/span&gt;); &lt;span class=&quot;hljs-keyword&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'title\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'null\'&lt;/span&gt;); &lt;span class=&quot;hljs-keyword&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'name\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'not null\'&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;如果你需要查询一个字段的值为字符串&lt;code&gt;null&lt;/code&gt;或者&lt;code&gt;not null&lt;/code&gt;，应该使用：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'title\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'=\'&lt;/span&gt;, &lt;span class=&quot;hljs-string&quot;&gt;\'null\'&lt;/span&gt;); &lt;span class=&quot;hljs-built_in&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-string&quot;&gt;\'name\'&lt;/span&gt;,&lt;span class=&quot;hljs-string&quot;&gt;\'=\'&lt;/span&gt;, &lt;span class=&quot;hljs-string&quot;&gt;\'not null\'&lt;/span&gt;); &lt;/code&gt;&lt;/pre&gt; &lt;h2 data-line=&quot;174&quot; class=&quot;line&quot;&gt;&lt;a id=&quot;EXP_174&quot;&gt;&lt;/a&gt;EXP：表达式&lt;/h2&gt; &lt;p&gt;支持更复杂的查询情况 例如：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;where&lt;/span&gt;(&lt;span class=&quot;hljs-symbol&quot;&gt;\'id&lt;/span&gt;&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt;&lt;span class=&quot;hljs-keyword&quot;&gt;in&lt;/span&gt;&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt;&lt;span class=&quot;hljs-number&quot;&gt;1&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;3&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;8&lt;/span&gt;\'); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;可以改成：&lt;/p&gt; &lt;pre&gt;&lt;code&gt;where(&lt;span class=&quot;hljs-symbol&quot;&gt;\'id&lt;/span&gt;&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt;exp&lt;span class=&quot;hljs-string&quot;&gt;\',\'&lt;/span&gt; &lt;span class=&quot;hljs-keyword&quot;&gt;IN&lt;/span&gt; (&lt;span class=&quot;hljs-number&quot;&gt;1&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;3&lt;/span&gt;,&lt;span class=&quot;hljs-number&quot;&gt;8&lt;/span&gt;) \'); &lt;/code&gt;&lt;/pre&gt; &lt;p&gt;&lt;code&gt;exp&lt;/code&gt;查询的条件不会被当成字符串，所以后面的查询条件可以使用任何SQL支持的语法，包括使用函数和字段名称。&lt;/p&gt; &lt;/div&gt;');

/*Table structure for table `tb_role` */

DROP TABLE IF EXISTS `tb_role`;

CREATE TABLE `tb_role` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '角色名称',
  `parent_id` int(12) NOT NULL DEFAULT '0' COMMENT '父角色id',
  `description` varchar(200) NOT NULL DEFAULT '' COMMENT '描述信息',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '角色状态',
  `sort_num` int(11) NOT NULL DEFAULT '0' COMMENT '排序值',
  `left_key` int(11) NOT NULL DEFAULT '0' COMMENT '用来组织关系的左值',
  `right_key` int(11) NOT NULL DEFAULT '0' COMMENT '用来组织关系的右值',
  `createtime` timestamp NULL DEFAULT NULL,
  `updatetime` timestamp NULL DEFAULT NULL,
  `level` int(11) NOT NULL DEFAULT '0' COMMENT '所处层级',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='角色';

