/*Table structure for table `tb_service` */

DROP TABLE IF EXISTS `tb_service`;

CREATE TABLE `tb_service` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '服务主键',
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '服务名称',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '服务描述',
  `picture` varchar(255) DEFAULT '' COMMENT '服务图片',
  `category_id` int(12) NOT NULL DEFAULT '0' COMMENT '所属类别',
  `price` int(80) NOT NULL DEFAULT '0' COMMENT '服务价格',
  `recommend` tinyint(2) DEFAULT '0' COMMENT '服务推荐:0表示不推荐，1表示推荐',
  `status` tinyint(2) DEFAULT '0' COMMENT '服务状态',
  `address` varchar(255) DEFAULT '' COMMENT '联系地址',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `publish_time` datetime DEFAULT NULL COMMENT '发布时间',
  `rich_text` text COMMENT '富文本区域',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `fk_service_category` (`category_id`),
  CONSTRAINT `fk_service_category` FOREIGN KEY (`category_id`) REFERENCES `tb_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

