insert  into `tb_service` values (1,'写字服务','这是使用人工智能技术提供写字服务，伴你一生便携式书写','/static/images/jenny.jpg',1,189,1,1,'http://wpa.qq.com/msgrd?v=3&uin=&site=qq&menu=yes',NULL,NULL,'2018-08-07 10:27:04','<p><strong style=\"text-indent: 2em;\">哔哔2：拳头透露下一款大作情报！网友：充值2万打底！</strong></p>\r\n<p>LOL已经发布9年，但拳头公司何时才会推出下一款大作却一直没有消息。不过最近拳头创始人Merrill在接受外媒采访时表示，新的大作已经在研发中，而且这款游戏不会是大众游戏。</p>\r\n<p class=\"p-image\" style=\"text-align: center;\"><img src=\"//i.17173cdn.com/2fhnvk/YWxqaGBf/cms3/PwlPgvbmufjlluE.jpg\" width=\"600\" height=\"323\" alt=\"timg.jpg\"></p>\r\n<p>“我们要做的是满足特定用户需求的游戏，而且是玩法优先，然后IP需要和游戏本身贴合，我们不会做大众游戏，就像当时做LOL也是为了一小部分玩家的需求一样”，Merrill说。</p>\r\n<p class=\"p-image\" style=\"text-align: center;\"><img src=\"//i.17173cdn.com/2fhnvk/YWxqaGBf/cms3/qpLJMKbmufjllud.jpg\" width=\"550\" height=\"363\" alt=\"tim2g.jpg\"><br>↑↑拳头游戏创始人之一的Marc Merrill（右）</p>\r\n<p>那么问题来了：你期待拳头公司的新游戏吗？你觉得会是什么类型呢？</p>\r\n<p><strong>BoYellow炜：</strong>英雄联盟宇宙出了，做个mmo完全没问题！</p>\r\n<p><strong>电动小马达：</strong>我觉得不如做些有剧情有机制的pve和pvp地图，打起来比千篇一律的对战有意思多了，顺便期待水晶之痕还有星之守护者地图的回归。</p>\r\n<p><strong>黄油作品赏析：</strong>新游戏？《提莫的一百种死法》应该会有不少人玩。</p>\r\n<p><strong>hCcCcCcCcco：</strong>出了充值两万打底！期待啊！拳头大作！</p>'),(2,'读书服务','这是使用最新的大数据分析技术提供的读书服务','/static/images/elyse.png',2,1223,0,1,'http://wpa.qq.com/msgrd?v=3&uin=&site=qq&menu=yes',NULL,NULL,'2018-08-07 10:27:04','<p><strong style=\"text-indent: 2em;\">哔哔2：拳头透露下一款大作情报！网友：充值2万打底！</strong></p>\r\n<p>LOL已经发布9年，但拳头公司何时才会推出下一款大作却一直没有消息。不过最近拳头创始人Merrill在接受外媒采访时表示，新的大作已经在研发中，而且这款游戏不会是大众游戏。</p>\r\n<p class=\"p-image\" style=\"text-align: center;\"><img src=\"//i.17173cdn.com/2fhnvk/YWxqaGBf/cms3/PwlPgvbmufjlluE.jpg\" width=\"600\" height=\"323\" alt=\"timg.jpg\"></p>\r\n<p>“我们要做的是满足特定用户需求的游戏，而且是玩法优先，然后IP需要和游戏本身贴合，我们不会做大众游戏，就像当时做LOL也是为了一小部分玩家的需求一样”，Merrill说。</p>\r\n<p class=\"p-image\" style=\"text-align: center;\"><img src=\"//i.17173cdn.com/2fhnvk/YWxqaGBf/cms3/qpLJMKbmufjllud.jpg\" width=\"550\" height=\"363\" alt=\"tim2g.jpg\"><br>↑↑拳头游戏创始人之一的Marc Merrill（右）</p>\r\n<p>那么问题来了：你期待拳头公司的新游