/*Table structure for table `tb_sps` */

DROP TABLE IF EXISTS `tb_sps`;

CREATE TABLE `tb_sps` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(30) NOT NULL COMMENT '名称',
  `picture` varchar(80) DEFAULT NULL COMMENT '形象图',
  `recommend` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否推荐',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='服务商表';

/*Data for the table `tb_sps` */

