/*Table structure for table `tb_teams` */

DROP TABLE IF EXISTS `tb_teams`;

CREATE TABLE `tb_teams` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `project_name` varchar(50) NOT NULL COMMENT '项目名称',
  `project_area` varchar(80) NOT NULL COMMENT '项目领域',
  `content` varchar(255) NOT NULL COMMENT '项目介绍',
  `company` varchar(60) NOT NULL COMMENT '公司机构名称',
  `register` int(10) NOT NULL COMMENT '团队人数',
  `picture` varchar(80) DEFAULT NULL COMMENT '团队形象图',
  `city_id` int(10) NOT NULL COMMENT '所在城市',
  `province_id` int(10) NOT NULL COMMENT '所在省份',
  `username` varchar(30) NOT NULL COMMENT '姓名',
  `mobile` varchar(11) NOT NULL COMMENT '手机号',
  `video` varchar(80) DEFAULT NULL COMMENT '路演视频地址',
  `business_plan` varchar(80) DEFAULT NULL COMMENT '商业计划书',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='参赛团队表';

/*Data for the table `tb_teams` */

/*Table structure for table `tb_tutors` */

DROP TABLE IF EXISTS `tb_tutors`;

CREATE TABLE `tb_tutors` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(30) NOT NULL COMMENT '姓名',
  `introduction` varchar(255) DEFAULT NULL COMMENT '简介',
  `picture` varchar(80) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '形象图',
  `recommend` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否推荐',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='创业导师表';

